import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, Marker, Polyline, useMapEvents } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import axios from 'axios';
import polyline from 'polyline';
import Navbar from './Navbar';

const API = 'https://invasion-api.onrender.com';

export default function App() {
  const [landings, setLandings] = useState([]);
  const [placingLanding, setPlacingLanding] = useState(false);
  const [localLandingId, setLocalLandingId] = useState(null);
  const [alienRoutes, setAlienRoutes] = useState({});
  const [log, setLog] = useState([]);
  const [showLog, setShowLog] = useState(false);
  const [searchId, setSearchId] = useState(null);

  const fetchLandings = async () => {
    const res = await axios.get(`${API}/api/landings`);
    setLandings(res.data);
    logEvent("üì• ◊®◊¢◊†◊ï◊ü ◊†◊ó◊ô◊™◊ï◊™ ◊û◊î◊©◊®◊™");
  };

  useEffect(() => {
    fetchLandings();
  }, []);

  const logEvent = (msg) => {
    const time = new Date().toLocaleTimeString();
    setLog(prev => [`${time} ‚Äì ${msg}`, ...prev]);
  };

  const generateAliens = async (landing) => {
    logEvent(`üëæ ◊ô◊ï◊¶◊®◊ô◊ù ◊ó◊ô◊ô◊ñ◊®◊ô◊ù ◊ú◊†◊ó◊ô◊™◊î ${landing.id}`);
    const directions = [0, 45, 90, 135, 180, 225, 270, 315];
    const routes = await Promise.all(
      directions.map(async (angle) => {
        const rad = angle * (Math.PI / 180);
        const to = [
          landing.lat + 0.05 * Math.cos(rad),
          landing.lng + 0.05 * Math.sin(rad)
        ];
        const routeRes = await axios.get(`${API}/api/route`, {
          params: {
            fromLat: landing.lat,
            fromLng: landing.lng,
            toLat: to[0],
            toLng: to[1]
          }
        });
        const decoded = polyline.decode(routeRes.data.routes[0].geometry);
        return decoded.map(([lat, lng]) => [lat, lng]);
      })
    );
    setAlienRoutes(prev => ({ ...prev, [landing.id]: routes }));
  };

  const handleStartPlacing = () => {
    setPlacingLanding(true);
    logEvent("üõ∏ ◊î◊§◊¢◊ú◊™ ◊û◊¶◊ë ◊ô◊¶◊ô◊®◊™ ◊†◊ó◊ô◊™◊î");
  };

  const handleDeleteLocal = () => {
    if (localLandingId) {
      setAlienRoutes(prev => {
        const updated = { ...prev };
        delete updated[localLandingId];
        return updated;
      });
      setLandings(prev => prev.filter(l => l.id !== localLandingId));
      logEvent(`‚ùå ◊†◊ó◊ô◊™◊î ${localLandingId} ◊†◊û◊ó◊ß◊î ◊û◊ß◊ï◊û◊ô◊™`);
      setLocalLandingId(null);
    }
  };

  const handleDeleteRemote = async () => {
    if (localLandingId) {
      await axios.delete(`${API}/api/landing/${localLandingId}`);
      logEvent(`üí• ◊†◊ó◊ô◊™◊î ${localLandingId} ◊†◊û◊ó◊ß◊î ◊û◊î◊©◊®◊™`);
      fetchLandings();
      setLocalLandingId(null);
    }
  };

  const handleSearchLanding = (val) => {
    const id = parseInt(val);
    if (!isNaN(id)) setSearchId(id);
    else setSearchId(null);
  };

  const ClickHandler = () => {
    useMapEvents({
      click: async (e) => {
        if (!placingLanding) return;

        const res = await axios.post(`${API}/api/landing`, {
          lat: e.latlng.lat,
          lng: e.latlng.lng
        });

        setLocalLandingId(res.data.id);
        logEvent(`üÜï ◊†◊ï◊¶◊®◊î ◊†◊ó◊ô◊™◊î ◊ó◊ì◊©◊î (${res.data.id})`);

        // ◊®◊¢◊†◊ü ◊ê◊™ ◊®◊©◊ô◊û◊™ ◊î◊†◊ó◊ô◊™◊ï◊™
        await fetchLandings();

        // ◊û◊¶◊ê ◊ê◊™ ◊î◊†◊ó◊ô◊™◊î ◊ú◊§◊ô ID
        const landing = {
          id: res.data.id,
          lat: res.data.lat,
          lng: res.data.lng,
        };
        await generateAliens(landing);

        setPlacingLanding(false);
      }
    });
    return null;
  };

  return (
    <div>
      <Navbar
        landingCount={landings.length}
        alienCount={Object.values(alienRoutes).flat().length}
        onStart={handleStartPlacing}
        onDeleteLocal={handleDeleteLocal}
        onDeleteRemote={handleDeleteRemote}
        onSearch={handleSearchLanding}
        log={log}
        showLog={showLog}
        toggleLog={() => setShowLog(!showLog)}
      />
      <MapContainer center={[32.1, 34.8]} zoom={11} style={{ height: '100vh', width: '100%' }}>
        <ClickHandler />
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; OpenStreetMap contributors'
        />
        {landings.map((landing) => (
          <Marker
            key={landing.id}
            position={[landing.lat, landing.lng]}
            eventHandlers={{
              click: () => setLocalLandingId(landing.id)
            }}
          />
        ))}
        {Object.entries(alienRoutes).map(([landingId, routes]) =>
          routes.map((route, i) => (
            <Polyline
              key={`${landingId}-${i}`}
              positions={route}
              color={searchId && parseInt(landingId) === searchId ? "blue" : "red"}
            />
          ))
        )}
      </MapContainer>
    </div>
  );
}
